// src/components/Navbar.tsx
import React from "react";
import { Menu } from "semantic-ui-react";
import { Link } from "react-router-dom";
import "../style/Navbar.css"; // Import the CSS file

export const Navbar = () => {
  return (
    <Menu inverted secondary>
      <Menu.Item position="left">
        <Menu.Item as={Link} to="/" className="menu-item">
          Ethan Jordon
        </Menu.Item>
      </Menu.Item>
      <Menu.Item position="right">
        <Menu.Item as={Link} to="/about" className="menu-item">
          About
        </Menu.Item>
        <Menu.Item as={Link} to="/skills" className="menu-item">
          Skills
        </Menu.Item>
        <Menu.Item as={Link} to="/projects" className="menu-item">
          Projects
        </Menu.Item>
        <Menu.Item as={Link} to="/contact" className="menu-item">
          Contact
        </Menu.Item>
        <Menu.Item as={Link} to="/resume" className="menu-item">
          Resume
        </Menu.Item>
      </Menu.Item>
    </Menu>
  );
};
